/**
 * Colour
 */
export const DOG_COLOUR = [
  {
    disabled: true,
    text: 'Select colour',
    value: ''
  },
  {
    text: 'Black',
    value: 'black'
  },
  {
    text: 'Brown',
    value: 'brown'
  },
  {
    text: 'Chocolate',
    value: 'chocolate'
  }
]
